/* Model creation/destruction functions */

void MODEL_mkFlowTest::create_model(tSimStateHdl simHdl, bool master)
{
  sim_hdl = simHdl;
  init_reset_request_counters(sim_hdl);
  mkFlowTest_instance = new MOD_mkFlowTest(sim_hdl, "top", NULL);
  bk_get_or_define_clock(sim_hdl, "CLK");
  if (master)
  {
    bk_alter_clock(sim_hdl, bk_get_clock_by_name(sim_hdl, "CLK"), CLK_LOW, false, 0llu, 5llu, 5llu);
    bk_use_default_reset(sim_hdl);
  }
  bk_set_clock_event_fn(sim_hdl,
			bk_get_clock_by_name(sim_hdl, "CLK"),
			schedule_posedge_CLK,
			NULL,
			(tEdgeDirection)(POSEDGE));
  (mkFlowTest_instance->INST_px.INST_p0_rv.set_clk_0)("CLK");
  (mkFlowTest_instance->INST_px.INST_p1_rv.set_clk_0)("CLK");
  (mkFlowTest_instance->INST_px.INST_p2_rv.set_clk_0)("CLK");
  (mkFlowTest_instance->INST_px.INST_p3_rv.set_clk_0)("CLK");
  (mkFlowTest_instance->INST_px.INST_p4_rv.set_clk_0)("CLK");
  (mkFlowTest_instance->INST_px.INST_p5_rv.set_clk_0)("CLK");
  (mkFlowTest_instance->INST_px.INST_p6_rv.set_clk_0)("CLK");
  (mkFlowTest_instance->INST_px.INST_p7_rv.set_clk_0)("CLK");
  (mkFlowTest_instance->INST_px.INST_p8_rv.set_clk_0)("CLK");
  (mkFlowTest_instance->INST_px.INST_mem_memory.set_clk_1)("CLK");
  (mkFlowTest_instance->INST_px.INST_mem_memory.set_clk_0)("CLK");
  (mkFlowTest_instance->INST_px.INST_mem_pwDequeue.set_clk_0)("CLK");
  (mkFlowTest_instance->INST_px.INST_mem_pwEnqueue.set_clk_0)("CLK");
  (mkFlowTest_instance->INST_px.INST_mem_pwClear.set_clk_0)("CLK");
  (mkFlowTest_instance->INST_px.INST_mem_wDataIn.set_clk_0)("CLK");
  (mkFlowTest_instance->INST_px.INST_mem_wDataOut.set_clk_0)("CLK");
  (mkFlowTest_instance->INST_px.INST_inQ.set_clk_0)("CLK");
  (mkFlowTest_instance->INST_px.set_clk_0)("CLK");
  (mkFlowTest_instance->set_clk_0)("CLK");
}
void MODEL_mkFlowTest::destroy_model()
{
  delete mkFlowTest_instance;
  mkFlowTest_instance = NULL;
}
void MODEL_mkFlowTest::reset_model(bool asserted)
{
  (mkFlowTest_instance->reset_RST_N)(asserted ? (tUInt8)0u : (tUInt8)1u);
}
void * MODEL_mkFlowTest::get_instance()
{
  return mkFlowTest_instance;
}

